import styles from "./Investment.module.css";
import image1 from "../investment_logo.png";
import data from "../investors";

const Investment = () => {
  return (
    <>
      {data.map((el) => {
        return (
          <div className={styles.investment}>
            <img src={image1} />
            <div className={styles.investmentDesc}>
              <h3>7AC TECHNOLOGY LLC</h3>
              <p>
                7AC offers a new approach to air conditioning technology,
                developing extreme energy savings and the ability to maximize
                climate friendly refrigerants
              </p>
              <a href="#">HTTP://WWW.7ACTECH.COM</a>
            </div>
          </div>
        );
      })}
    </>
  );
};

export default Investment;
